const userSignupFormHandler=async a=>{a.preventDefault(),console.log("user submit button clicked");const b=document.querySelector("#firstName").value.trim(),c=document.querySelector("#lastName").value.trim(),d=document.querySelector("#email").value.trim(),e=document.querySelector("input[name=\"gender\"]:checked").value,f=document.querySelector("input[name=\"genderPref\"]:checked").value,g=document.querySelector("#password").value.trim(),h=document.querySelector("#zip").value.trim();if(b&&c&&d&&g&&h&&e&&f){const a=await fetch("/api/users/ownerprofile",{method:"POST",body:JSON.stringify({firstName:b,lastName:c,email:d,password:g,zipcode:h,gender:e,genPref:f}),headers:{"Content-Type":"application/json"}});a.ok?document.location.replace("/dogprofile"):(sweetAlert.fire({title:"User profile not created",text:a.statusText,icon:"warning"}),console.log("UserSignup JS failing"))}};document.querySelector("#userSubmit").addEventListener("click",userSignupFormHandler),$(function(){var a=$("#email");a.change(function(){$("#userName").val(a.val())})}),document.querySelector("#friendPrefInfo").addEventListener("click",function(){sweetAlert.fire({title:"Gender Preference",text:"We will try to match you with human friends of this gender"})});